// LoginPage.js
import React from 'react';
import './LoginPage.css';

const LoginPage = () => {
  return (
    <div className="login-container">
      <h1 className="welcome-text">Welcome to Seekhan!</h1>
      <button className="login-button">Login</button>
    </div>
  );
};

export default LoginPage;
